        name: Joi.string().min(5).max(50).required(),
        phone: Joi.string().min(10).max(10).required(),
        email: Joi.string().min(5).max(255).required().email()
    };

    return Joi.validate(customer, schema);
}
exports.validate = validateCustomer;

